import React from 'react';
import ReactDOM from 'react-dom';
import CharacterCard from './CharacterCard';



const App = () => {
  return (
    <div className="ui three doubling cards">
      <CharacterCard />
      <CharacterCard />
    </div>
  );
};


ReactDOM.render(
  <App />,
  document.querySelector('#root')
);
